    const [A3_, A3__] = useState('#FFF')
    const [B3_, B3__] = useState('#FFF')
    const [C4_, C4__] = useState('#FFF')
    const handleKeyDown = (event: KeyboardEvent) => {
        if (event.key === 'q') {
            var sound = new Audio(C1);
            sound.play();
