            resetColor();
        }
        if (event.key === '5') {
            var sound = new Audio(Gb1);
            sound.play();
        }
        if (event.key === 't') {
            var sound = new Audio(G1);
            sound.play();
            G1__("#990000");
            resetColor();
        }
        if (event.key === '6') {
            var sound = new Audio(Ab1);
            sound.play();
        }
        if (event.key === 'y') {
            var sound = new Audio(A1);
            sound.play();
            A1__("#990000");
            resetColor();
        }
        if (event.key === '7') {
            var sound = new Audio(Bb1);
            sound.play();
        }
        if (event.key === 'u') {
            var sound = new Audio(B1);
            sound.play();
            B1__("#990000");
            resetColor();
        }
        if (event.key === 'i') {
            var sound = new Audio(C2);
