            C2__("#990000");
            resetColor();
        }
        if (event.key === '9') {
            var sound = new Audio(Db2);
            sound.play();
        }
        if (event.key === 'o') {
            var sound = new Audio(D2);
            sound.play();
            D2__("#990000");
            resetColor();
        }
        if (event.key === '0') {
            var sound = new Audio(Eb2);
            sound.play();
        }
        if (event.key === 'p') {
            var sound = new Audio(E2);
            sound.play();
            E2__("#990000");
            resetColor();
        }
        if (event.key === '@') {
            var sound = new Audio(F2);
            sound.play();
            F2__("#990000");
            resetColor();
        }
        if (event.key === '^') {
            var sound = new Audio(Gb2);
            sound.play();
        }
        if (event.key === '[') {
            var sound = new Audio(G2);
            sound.play();
            G2__("#990000");
            resetColor();
        }
        if (event.key === '¥') {
            var sound = new Audio(Ab2);
            sound.play();
        }
        if (event.key === 'z') {
            var sound = new Audio(A2);
            sound.play();
            A2__("#990000");
            resetColor();
        }
        if (event.key === 's') {
            var sound = new Audio(Bb2);
            sound.play();
        }
        if (event.key === 'x') {
            var sound = new Audio(B2);
            sound.play();
            B2__("#990000");
            resetColor();
        }
        if (event.key === 'c') {
            var sound = new Audio(C3);
