        if (event.key === 'n') {
            var sound = new Audio(F3);
            sound.play();
            F3__("#990000");
            resetColor();
        }
        if (event.key === 'j') {
            var sound = new Audio(Gb3);
            sound.play();
        }
        if (event.key === 'm') {
            var sound = new Audio(G3);
            sound.play();
            G3__("#990000");
            resetColor();
        }
        if (event.key === 'k') {
            var sound = new Audio(Ab3);
            sound.play();
        }
        if (event.key === ',') {
            var sound = new Audio(A3);
            sound.play();
            A3__("#990000");
            resetColor();
        }
        if (event.key === 'l') {
            var sound = new Audio(Bb3);
            sound.play();
        }
        if (event.key === '.') {
            var sound = new Audio(B3);
            sound.play();
            B3__("#990000");
            resetColor();
        }
        if (event.key === '/') {
            var sound = new Audio(C4);
            sound.play();
            C4__("#990000");
            resetColor();
        }
    }
    useEffect(() => {
        document.addEventListener('keydown', handleKeyDown, false)
    }, [])

    const resetColor = useCallback(() => {
        setTimeout(() => {
            C1__("#FFF");
            D1__("#FFF");
        }, 100);
    }, [C1_, D1_, E1_, F1_, G1_, A1_, B1_, C2_, D2_, E2_, F2_, G2_, A2_, B2_, C3_, D3_, E3_, F3_, G3_, A3_, B3_, C4_]);

    return (
        <Box className="Piano">
            <Box className="Piano-white">
                <Button className="C1" variant="contained" sx={{ backgroundColor: C1_, border: "1px solid #000", "&:hover": { opacity: 1 } }} color="error"></Button>
