                <Button className="B3" variant="contained" sx={{ backgroundColor: C1_, border: "1px solid #000", "&:hover": { opacity: 1 } }} color="error"></Button>
                <Button className="C4" variant="contained" sx={{ backgroundColor: C1_, border: "1px solid #000", "&:hover": { opacity: 1 } }} color="error"></Button>
            </Box>
            <Box className="Piano-black">
                <Button className="Db1" variant="contained" sx={{ backgroundColor: C1_, border: "1px solid #000", margin: "0 0 0 30px", "&:hover": { opacity: 1 } }} color="error"></Button>
                <Button className="Eb1" variant="contained" sx={{ backgroundColor: C1_, border: "1px solid #000", margin: "0 0 0 5px", "&:hover": { opacity: 1 } }} color="error"></Button>
